import logo from './logo.svg';
import './App.css';
import { useEffect } from 'react'

const data = () => {
  fetch("https://datausa.io/api/data?drilldowns=Nation&measures=Population)")
  .then((response) => response.json())
  .then(function (response) {
    console.log(response);
  })
}
function App() {
  useEffect(() => {
    data();
  }, []);
  return (
    <div className="App">

    </div>
  );
}

export default App;
